comments.message:
You can just put "Namespace" here.

  return "Namespace";

That simplifies the code and may even result in more efficient code when optimization is not enabled.

I'll add more detail.

 // Always call get resource, which will give you a resource, if there was already an io or
 // observation resource there, then this function is supposed to return LE_NO_PARAMETER.

If by "this function", you mean "get resource", then it will actually return LE_OK if there's already an io or observation resource there. It will not return LE_BAD_PARAMETER or LE_NO_MEMORY.

If by "this function", you mean resTree_CreateInput(), then it will abort if there's already an io or observation resource there. It will not return anything.

Better to use a type-safe opaque pointer type like this:

 typedef struct fileUtils_File* fileUtils_FileRef_t;

'struct fileUtils_File' doesn't actually need to be defined anywhere, but if it is defined anywhere it must only be inside fileUtils.c. It must be an incomplete type outside of fileUtils.c.

Perhaps something like

    if (res == LE_OK || pushRes == LE_NO_MEMORY)
    {
        // Latch in error result if a push fails in the middle of processing multiple
        // destinations.  Precedence: LE_OK < [other errors] < LE_NO_MEMORY
        res = pushRes;
    }
